import React, { Component } from 'react';
import {Form,Button} from 'react-bootstrap';
import './App.css';
import { render } from '@testing-library/react';

class Login extends Component
{
render()  {
  return (
    <div className="Login" class="centered" >
   <form>
     <Form.Group controlId = "UserName">
     <Form.Label bsSize="large" >
       UserName
     </Form.Label>
       <Form.Control type="UserName" placeholder="Enter Username" bsSize="large">
       </Form.Control>
     </Form.Group>
     <Form.Group controlId = "Password" class="space">
     <Form.Label bsSize="large">
       Password
     </Form.Label>
       <Form.Control type="Password" placeholder="Enter Password" bsSize="large">
       </Form.Control>
     </Form.Group>
     <Form.Group class="space">
     <Button variant="primary" bsSize="large" type="submit">
      Login
     </Button>
     <Button bsSize="large" variant="primary" type="button">
      Reset
     </Button>
     </Form.Group>
   </form>
    </div>
  );
}
}

export default Login;
